  console.log("specjal", specjalizacje)

  return (
    <>
    <section className='flex flex-row h-full w-72'>
      <div className='h-full w-36 bg-violet-600 shadow shadow-violet-800 flex flex-col'>
        {specjalizacje.map((specialty, i) => (
          <div className='w-full py-6 px-4 text-xl font-semibold border-b border-white hover-violet-800' key={i} title={specialty.opis}>{specialty.nazwa}</div>
